INSERT INTO `package_language` VALUES (2, 2, 1, 'paquete 2', 'paquete2', 'Recomendamos presentarse en el aeropuerto al menos con dos horas de antelación a la salida del vuelo. Así, tendrás tiempo suficiente para facturar, entregar tu equipaje, pasar el/ los control(es)', NULL, '2017-12-08 13:33:58', '2017-12-08 13:25:47', '2017-12-08 13:25:47', 1, 1);
INSERT INTO `package_language` VALUES (3, 3, 1, 'paquete 3', 'paquete3', 'Consulta toda la información sobre el Aeropuerto de Barcelona: accesos, servicios y toda la información sobre la T1 (Todos los vuelos de Iberia y sus compañías asociadas, parten y llegan a la T1 de', NULL, '2017-12-08 13:34:12', '2017-12-08 13:25:47', '2017-12-08 13:25:47', 1, 1);
INSERT INTO `package_language` VALUES (4, 4, 1, 'paquete 4', 'paquete4', 'Recomendamos presentarse en el aeropuerto al menos con dos horas de antelación a la salida del vuelo. Así, tendrás tiempo suficiente para facturar, entregar tu equipaje, pasar el/ los control(es) de inmigración y seguridad y llegar a la puerta de embarque.', NULL, '2017-12-08 13:34:26', '2017-12-08 13:25:47', '2017-12-08 13:25:47', 1, 1);
