INSERT INTO `product_language` VALUES (10, 10, 1, 'Aqtúa Mandarina Supreme, Caja Con 30 sobres', 'Aqtúa Tangerine Supreme, Caja Con 30 sobres\r\nLa Coenzima QH o Ubiquinol es un antioxidante que puede favorecer la protección de las células del organismo y puede colaborar en el funcionamiento de los músculos y el corazón.\r\nLa L-carnitina promueve la utilización de las grasas como fuente de energía.\r\nEl Magnesio es importante para el funcionamiento del sistema nervioso y muscular.\r\nLa D-ribosa participa en la producción de energía.', 'Aqtúa Tangerine Supreme, Caja Con 30 sobres\r\nContiene: coenzima QH, l-carnitina, ribosa, magnesio, estevia. \r\nSabor: mandarina. ', 'Con agua Blu Supreme. A cualquier hora del d&iacute;a.', '3924734_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
