INSERT INTO `product_language` VALUES (12, 12, 1, 'One C Mix Plus, Caja Con 30 Sobres', 'One C Mix Plus, Caja Con 30 sobres\r\nEl Glutatión actúa como antioxidante y ayuda a fortalecer el sistema inmunológico.\r\nLas vitaminas A, C y E actúan como antioxidante, favoreciendo la protección de las células del organismo.', 'One C Mix Plus, Caja Con 30 sobres\r\nContiene: Glutation, vitaminas, minerales, estevia\r\nSabor: Mango ', 'Con agua Blu Supreme. A cualquier hora del día.', '6379929_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (13, 13, 1, 'Starbien, Bote (615 G)', 'Starbien, Bote (615 G)\r\nLas Vitaminas del complejo B participan en la función cerebral y en la producción de energía.\r\nEl Ácido fólico ayuda a disminuir los riesgos de defectos en el tubo neural del futuro bebé.\r\n', 'Starbien, Bote (615 G)\r\nContiene: Vitaminas del complejo B, ácido fólico.\r\nSabor: Frutas. ', 'No disponible', '3020700_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
