INSERT INTO `product_language` VALUES (17, 17, 1, 'Ego Plant, Botella (200 Ml)', 'Ego Plant, Botella (200 Ml)\r\nLos extractos herbales actúan como diuréticos naturales, apoyando el cuidado renal.', 'Ego Plant, Botella  (200 Ml) \r\nContiene: extractos herbales \r\nSabor: herbal ', 'A cualquier hora del día. Frío.', '1210600_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (18, 18, 1, 'Ego Plant, Botella (200 Ml) (Paquete de 24) ', 'Helps support healthy kidneys\r\nSupports a healthy urinary system', 'Ego Plant is a dietary supplement that contains herbal extracts such as L. Cynara Scolymus (artichoke), Orthosiphon Stamineus leaf (java), Lespedeza Capitata Michx leaf (roundhead bush-clover), Equisetum Arvense leaf (common horsetail), and Herniaria Glabra (smooth rupturewort). In addition, it contains vitamins D, E, and B12, which can help support healthy kidneys. Ego Plant reduces liquid retention thanks to its natural diuretic effect and supports a healthy balance in body liquids.\r\n\r\nRECOMMENDED USE\r\nTwo or three times per day.', 'No disponible', '1210695_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (19, 19, 1, 'Estop, Caja Con 20 Sachets', 'Promotes cardiovascular health\r\nCan help reduce blood lipids (cholesterol and triglycerides)\r\nCan help maintain healthy cholesterol levels\r\n', 'An almond-flavored dietary supplement sweetened with Stevia. This supplement contains almond powder extract (a source of phytosterols), sugar cane wax extract (a source of policosanol), inulin, and vitamin E. In combination, these ingredients support healthy cholesterol levels and cardiovascular health. \r\n\r\nRECOMMENDED USE \r\nThree times per day with a meal.', 'No disponible', '1320900_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (20, 20, 1, 'Estop Plus, Caja Con 30 Sobres (450G)', 'Estop Plus, Caja Con 30 sobres  (450G)\r\nEl Extracto de cera de caña y el extracto de almendra en polvo  ayudan a mantener un cuidado saludable para grasas en sangre.', 'Estop Plus, Caja Con 30 sobres   (450G)\r\nContiene: extracto de almendra en polvo, extracto de cera de caña, inulina, vitamina e, estevia \r\nSabor : nuez vainilla', 'Con agua Blu Supreme. A cualquier hora del día.', '1675700_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (21, 21, 1, 'Fem Oml Plus, Caja Con 30 Sachets (195 G)', 'Fem Oml Plus, Caja Con 30 Sobres (195 G)\r\nEl Extracto de soya y extracto de flor de lúpulo(Fitoestrógenos) colaboran en el funcionamiento fisiológico del organismo, incluso en etapas como la del climaterio y menopausia.\r\n', 'Fem Oml Plus, Caja Con 30 Sachets  (195 G)\r\nContiene: Extracto de soya, extracto de flor de lúpulo, Extracto de semilla de uva, vitaminas y minerales, estevia.\r\nSabor: Durazno ', 'Con agua Blu Supreme. A cualquier hora del día.', '1429653_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
