INSERT INTO `product_language` VALUES (23, 23, 1, 'Hom Oml Plus, Caja Con 30 Sobres (180G)', 'Hom Oml Plus, Caja Con 30 Sobres (180G)\r\nEl licopeno y el boro colaboran en el funcionamiento de la prostata. \r\nEl extracto de arándano favorece al buen cuidado de las vías urinarias. ', 'Hom Oml Plus, Caja Con 30 Sobres (180G)\r\nContiene: Licopeno, extracto de soya, boro, extracto de arándano, estevia\r\nSabor: Mandarina ', 'Con agua Blu Supreme. A cualquier hora del día.', '1729752_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (24, 24, 1, 'Oml Focus, Bote (555 G)', 'Supports improved concentration, memory and learning\r\nSupports the production of energy\r\nPromotes a healthy nervous system', 'A dietary supplement that has choline, glycine, taurine, B-complex vitamins, and vitamins C and E as its key ingredients. In conjunction, they help stimulate the nervous system - transmitting nerve impulses from the brain to every part of the body - supporting the production of energy, as well as improve concentration, memory, and learning abilities.\r\n\r\nRECOMMENDED USE\r\nOnce per day.', 'No disponible', '2521300_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (25, 25, 1, 'Oml Focus, Caja Con 30 Sachets', 'Oml Focus, Caja Con 30 Sachets / Box With 30 Sachets\r\nLa Colina y la Glicina favorecen el funcionamiento del sistema nervioso.\r\nVitaminas del complejo B: participan en la función cerebral.', 'Oml Focus, Caja Con 30 Sachets / Box With 30 Sachets\r\nContiene: Colina, glicina y vitaminas del complejo B.\r\nSabor: cítrico.', 'Con agua Blu Supreme. A cualquier hora del día.', '2523600_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
