INSERT INTO `product_language` VALUES (32, 32, 1, 'Malteada Oml Vanilla, Doypack ', 'Helps strengthen the immune system\r\nSupports the production of hemoglobin\r\nPromotes bone and muscle strength\r\nSupports the health of the cardiovascular and nervous systems\r\nSupports overall health', 'A dietary supplement made with soy protein, carbohydrates, fiber, vitamins, and minerals. These ingredients complement a healthy diet and benefit the entire body, supporting overall health. Amongst its main benefits are strengthening the immune system, supporting the production of hemoglobin thanks to its iron content, strengthening bones and muscles due to its calcium, vitamin D and protein content, as well as supporting the health of the cardiovascular and nervous systems thanks to its content of DHA fatty acids (Omega-3). \r\n\r\nRECOMMENDED USE\r\nTwice per day. ', 'No disponible', '3125316_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
