INSERT INTO `product_language` VALUES (43, 43, 1, 'Oml Viu Supreme, Bote (200 G)', 'Supports healthy eyesight\r\nHelps delay loss of eyesight caused by aging \r\nHelps protect eyes against damage caused by UV rays\r\nHelps improve eyes resistance to shine and brightness\r\nSweetened with Stevia', 'Sugar-free dietary supplement sweetened with stevia that has a high content of fiber, vitamins A, C and E, lutein and zeaxanthin (carotenoids), redcurrant, cranberry, Jamaica and grape extracts, as well as omega 3. Together these ingredients help support a healthy body thanks to their antioxidant and nutritional value. The main benefits are associated with healthy eyesight.\r\n\r\nRECOMMENDED USE\r\nTwo servings per day.', 'No disponible', '5877615_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
