INSERT INTO `product_language` VALUES (58, 58, 1, 'Teatino Limón Supreme, Botella (300 G)', 'Promotes healthy weight management\r\nSupports a healthy metabolism\r\nHelps burn fat and develop muscle\r\nHelps support healthy glucose levels\r\nSweetened with Stevia.', 'A low-calorie dietary supplement sweetened with stevia that contains chromium and soluble tea extract (black tea Camellia Sinensis) amongst its key ingredients. In conjunction, they can help support certain metabolic functions implicated in weight management. Also contains L-carnitine that helps burn fat and develop muscle. The black tea extract also provides beneficial antioxidant, anti-inflammatory, antiviral, and anticarcinogenic properties.\r\n\r\nRECOMMENDED USE\r\nOnce per day.', 'No disponible', '3576705_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
