INSERT INTO `product_language` VALUES (101, 101, 1, 'Crema Aclaradora Facial', 'Crema Aclaradora Facial\r\nSiente el efecto de su fórmula con extracto de té verde, uva y vitamina E que favorece la limpieza y aclaración de la piel sin irritarla. Además, ahora viene reforzada con humectantes y emolientes que proporcionan suavidad a tu piel y le dan una sensación sedosa al tiempo que aclara, humecta y acondiciona.', 'Crema Aclaradora Facial\r\nFavorece la limpieza y aclaración de la piel sin irritar.', '- Ayuda a desvanecer las manchas de la piel, especialmente las causadas por el sol - Contiene &aacute;cido glic&oacute;lico, vitaminas C y E, extractos de uva ursi y t&eacute; verde - Para obtener mejores resultados es recomendable usar la Crema Protectora Solar FPS 50 o Crema Facial con Protecci&oacute;n Solar', '9501074_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (102, 102, 1, 'Desmaquillante Para Ojos Bifásico', 'Desmaquillante Para Ojos Bifásico\r\nCUIDADO DE LA PIEL / FACIAL - LIMPIEZA\r\nLa piel que bordea los ojos es la más fina y delicada del rostro, por ello hay que desmaquillar la zona correctamente todas las noches. Por su fórmula con ingredientes naturales, como la manzanilla, pepino, vitamina E, alantoina y bisabolol, nuestro Desmaquillante de Ojos ayuda a aligerar la piel y colabora a la regeneración celular, sin dejar sensación grasosa ni provocar irritación ni lágrimas.\r\n', 'Desmaquillante Para Ojos Bifásico\r\nLa piel que bordea los ojos es la más fina y delicada\r\n', '- Formulado con un pH Ideal para no irritar  - Enriquecido con Vitamina E, bisabolol y alantoína, así como extractos de pepino y manzanilla  - Libre de sensación grasosa', '9501088_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (103, 103, 1, 'Mascarilla Facial', 'Mascarilla Facial\r\nCUIDADO DE LA PIEL / FACIAL - LIMPIEZA\r\nLas mascarillas son parte imprescindible de nuestra rutina de cuidado facial. Dale luz a tu rostro con la frescura y suavidad de una piel radiante. Limpia a profundidad y evita la molesta deshidratación. ¡Consentirte así toma sólo unos minutos! Su fórmula, compuesta con extracto de avena, papaya, algas marinas y extracto de aloe vera, humecta y tonifica el rostro, limpiándolo a profundidad.', 'Mascarilla Facial\r\nLuce un rostro natural en tu día a día.', '- Con papaína que ayuda a eliminar las células muertas  - Aporta hidratación, suavidad y frescura  - Enriquecida con aceite de soya, vitamina E y extractos de zanahoria, aloe vera, avena y algas marinas	  - Protege, hidrata y acondiciona el rostro', '9501079_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (104, 104, 1, 'Exfoliante Facial Con Extracto De Ginseng', 'Exfoliante Facial Con Extracto De Ginseng\r\nCUIDADO DE LA PIEL / FACIAL - LIMPIEZA\r\nPresume un nuevo rostro revitalizado y libre de impurezas. Su fórmula con extracto de ginseng y hamamelis, contribuye a hidratar y regenerar tu piel, recuperando su apariencia joven y tersa, además de que contribuye a mantener su PH ideal. Su acción antioxidante remueve las impurezas del cutis, y brinda una sensación de frescura por su aroma cítrico.', 'Exfoliante Facial Con Extracto De Ginseng\r\nPresume un nuevo rostro revitalizado y libre de impurezas.', '- Textura granulosa para retirar las células muertas - Proporciona una limpieza profunda - Enriquecida con ginseng y hamamelis - para todo tipo de piel', '9501071_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (105, 105, 1, 'Crema Limpiadora Facial', 'Crema Limpiadora Facial\r\nCUIDADO DE LA PIEL / FACIAL - LIMPIEZA\r\nLimpia profundamente tu rostro y libéralo de impurezas, manteniendo el balance natural de la piel. Remueve de forma fácil y suave el maquillaje del rostro y ojos, tonifica y humecta la piel. Su textura ligera y de rápida absorción es ideal para todo tipo de piel. Con extracto de manzanilla, pantenol, vitamina E y aceite de aguacate que dejan tu cutis limpio y suave, mientras proporcionan una sensación refrescante.', 'Crema Limpiadora Facial\r\nLimpia profundamente tu rostro y libéralo de impurezas', '-	Ideal para desmaquillar rostro y ojos  -	Con extracto de manzanilla, pantenol, vitamina E, aceite de aguacate, aceite de girasol y queratina hidrolizada  -	Textura ligera y de rápida absorción  -	Acondiciona y humecta la piel', '9501073_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (106, 106, 1, 'Tonico Hidratante', 'Tonico Hidratante\r\nCUIDADO DE LA PIEL / FACIAL - LIMPIEZA\r\n¡La satisfacción de sentirte bien y revitalizar tu piel! Contribuye al balance de hidratación ideal para el cutis. Formulado para piel sensible o que ha sido sometida a tratamientos faciales, contiene extractos como el aloe vera, árnica y hamamelis, los cuales ayudan a disminuir la sensación de irritación colaborando a mejorar la calidad de la piel y proporcionarle una apariencia saludable', 'Tonico Hidratante\r\n¡La satisfacción de sentirte bien y revitalizar tu piel!', '- Ayuda a frenar la deshidrataci&oacute;n de la piel - Refrescante y revitalizante natural - Colabora disminuyendo la sensaci&oacute;n de irritaci&oacute;n - Con vitaminas E y C, aceite de lavanda, pantenol, bisabolol, extractos de aloe vera, &aacute;rnica, pepino, zanahoria, hamamelis, ginseng.', '9501083_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (107, 107, 1, 'Concentrado Revitalizante', 'Concentrado Revitalizante', 'Concentrado Revitalizante\r\nRevitaliza tu belleza facial\r\n', '- Colabora con la reparación y regeneración intensiva de la piel   - hidratación continua  - Complemento Ideal para la línea nutritiva de día y noche', '9501089_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (108, 108, 1, 'Espuma Limpiadora Facial', 'Espuma Limpiadora Facial\r\nCUIDADO DE LA PIEL / FACIAL - LIMPIEZA\r\nEl cuidado de la piel del rostro es importante para todos. Por eso nuestra Espuma Facial, a base de ingredientes naturales, brinda una limpieza profunda para toda la familia. Gracias a la combinación de sus ingredientes como el extracto de aloe vera, remueve las impurezas de la piel dejándola hidratada. Además, la moringa da frescura y suavidad a tu cutis. Goza de su excelente capacidad de formar espuma cremosa y multi-funcional.\r\n', 'Espuma Limpiadora Facial\r\nBrinda una limpieza profunda para toda la familia\r\n', '- Ideal para la limpieza diaria del cutis  - Remueve impurezas de la piel  - Enriquecida con extractos de aloe vera, moringa y alga  - Intensa sensación de frescura', '9519033_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (109, 109, 1, 'Crema Facial De Día', 'Crema Facial De Día\r\nFACIAL\r\nMejora la apariencia y protege diariamente tu piel. Ofrece una protección básica contra los rayos solares. De rápida absorción. Retrasa la aparición de líneas de expresión. Propiedades que colaboran a reafirmar y acondicionar la piel. Con extractos naturales que permiten el balance perfecto en la hidratación', 'Crema Facial De Día\r\nAyuda a regenerar de forma natural la vitalidad de tu rostro', 'No disponible', '9501095_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (110, 110, 1, 'Crema Facial De Noche', 'Crema Facial De Noche\r\nCUIDADO DE LA PIEL / FACIAL - CUTIS NORMAL\r\nSiente el efecto de su fórmula con extracto de té verde, uva y vitamina E que favorece la limpieza y aclaración de la piel sin irritarla. Además, ahora viene reforzada con humectantes y emolientes que proporcionan suavidad a tu piel y le dan una sensación sedosa al tiempo que aclara, humecta y acondiciona.', 'Crema Facial De Noche\r\nFavorece la limpieza y aclaración de la piel sin irritarla', '- Ayuda a retrasar los signos de la edad mientras duermes - Despierta con una piel radiante y m&aacute;s saludable - Mantiene tu piel hidratada y suave - Enriquecida con extracto de hojas de t&eacute; verde, vitaminas del complejo B, A, C y E', '9501096_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (111, 111, 1, 'Suero Para Contorno De Ojos De Hidratación Profunda Con Aloe Vera', 'Cuidar el contorno de tus ojos es fundamental para lucir más radiante y\r\nevitar la apariencia de las microarrugas. Contiene aloe vera, extracto de pepino, precursores de colágeno y proteína de soya. Mejora la circulación disminuyendo la apariencia oscura de las ojeras. Ayuda a que tu piel se mantenga firme, saludable, suave y luminosa. Proporciona una mejor distribución y absorción.\r\n', 'Cuidar el contorno de tus ojos es fundamental para lucir más radiante y\r\nevitar la apariencia de las microarrugas. Contiene aloe vera, extracto de pepino, precursores de colágeno y proteína de soya. Mejora la circulación disminuyendo la apariencia oscura de las ojeras. Ayuda a que tu piel se mantenga firme, saludable, suave y luminosa. Proporciona una mejor distribución y absorción.\r\n', 'No disponible', '9501094_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (112, 112, 1, 'Suero Facial De Hidratacion Profunda c/Aloe', 'Mantiene tu piel con un aspecto más suave, terso y con una apariencia más\r\nLuminosa. Fórmula a base de aloe vera, cuenta con activos de vanguardia como los péptidos, precursores del colágeno y el hialurónato de sodio. Siente una mejor distribución y absorción del product. Ayuda a reducir las finas líneas de expresión causadas por la resequedad.\r\n', 'Ideal para ayudar a reducir las finas líneas de expresión causadas por la resequedad\r\n-Permite una humectación profunda y prolongada en la piel\r\n-Textura suave y ligera de fácil absorción\r\n-Enriquecido con Péptidos precursores del colágeno y Ácido Hialurónico, la combinación perfecta para proporcionarle elasticidad y firmeza a tu piel\r\n', '- Humectación profunda y prolongada  - ayuda a prevenir la aparición de finas líneas de expresión  - Fácil absorción', '9501093_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (113, 113, 1, 'Crema Facial Para Cutis Mixto Graso', 'Crema Facial Para Cutis Mixto Graso\r\nCUIDADO DE LA PIEL / FACIAL - CUTIS MIXTO A GRASO\r\nOlvida los mitos que dicen que no puedes usar crema facial. Si tienes el cutis graso o con tendencia al acné, también tú puedes mejorar la apariencia de tu piel. Hidrata y refresca tu rostro con esta crema facial ideal para ti con su fórmula con extractos herbales y antioxidantes como vitamina A, C y E.', 'Crema Facial Para Cutis Mixto Graso\r\nSi tienes el cutis graso o con tendencia al acné.', '- Con vitamina A, C y E - Con extractos herbales como cal&eacute;ndula, l&uacute;pulo, cola de caballo y romero - Hidrata, suaviza, tonifica y refresca la piel', '9501100_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (114, 114, 1, 'Tónico Astringente Para Cutis Mixto-Graso', 'Refresca tu energía y renueva la apariencia de tu piel con el Tónico Astringente, que contribuye al balance de la grasa de tu cutis de manera natural. Ideal para piel mixta-grasa. Proporciona un aspecto luminoso y libre de impurezas a la piel. Ayuda a detener la deshidratación. Elimina el exceso de grasa.', 'Contribuye a balancear el sebo de tu cutis de manera natural. Ideal para piel mixta - grasa\r\n-Auxiliar en la reparación, luminosidad e hidratación de la piel\r\n-Enriquecido con Hamamelis, Vitamina C, Mentol y extracto de Zanahoria, que cuidan y colaboran en el equilibrio de la piel\r\n-El extracto de zanahoria ayuda a combatir los signos del envejecimiento y a proteger nuestra piel ante las agresiones externas\r\n', '-      Contribuye a balancear el sebo de tu cutis de manera natural  -      Ayuda a detener la deshidratación  -      Refresca, tonifica y suaviza  -      Enriquecido con Vitamina C y Extractos de zanahoria, hamamelis y menta', '9501085_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (115, 115, 1, 'Gel Limpiador Para Cutis Mixto-Graso', 'Gel Limpiador Para Cutis Mixto-Graso\r\nCUIDADO DE LA PIEL / FACIAL - CUTIS MIXTO A GRASO\r\n¡Para que luzcas espectacular! mantén la piel libre de impurezas, al mismo tiempo que suaviza, tonifica e hidratas. Contiene extracto de pepino que colabora a formar una capa protectora sobre la piel, para que no se reseque ni se descame; extractos naturales y adición de vitaminas C y E, contribuyen a proteger el cutis de los efectos nocivos del medio ambiente.\r\n', 'Gel Limpiador Para Cutis Mixto-Graso\r\nMantén la piel libre de impurezas, al mismo tiempo que suaviza, tonifica e hidratas.', '- Contribuye a proteger el cutis de los efectos negativos del ambiente  - Rico en antioxidantes como la vitamina E y C  - Con ácido salicílico  - Enriquecido con aceite de soya y extractos de aloe vera, pepino y salvia ', '9501084_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (116, 116, 1, 'Gel Exfoliante Para Cutis Mixto-Graso', 'Gel Exfoliante Para Cutis Mixto-Graso.\r\nCUIDADO DE LA PIEL / FACIAL - CUTIS MIXTO A GRASO\r\nDeja que tu cara y cuerpo luzcan en todo su esplendor. Diseñado para exfoliar suave y cuidadosamente la piel de cutis mixto-graso, dándole una sensación de frescura. Formulada con finos granos de arroz y nuez que ayudan a remover las impurezas del cutis. Aloe vera, té verde y jengibre, ingredientes que colaboran con la hidratación de la piel. Puede usarse en todo el cuerpo.\r\n', 'Gel Exfoliante Para Cutis Mixto-Graso.\r\nDeja que tu cara y cuerpo luzcan en todo su esplendor.', '- Hidrata y revitaliza la piel  - ayuda a Remover las impurezas del cutis  - Contiene extractos de aloe vera, té verde y bambú  - con cáscara de nuez y finos granos de arroz', '9501086_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (117, 117, 1, 'Crema Nutritiva De Dia Para Pieles Maduras', 'Crema Nutritiva De Día Para Pieles Maduras\r\nCUIDADO DE LA PIEL / FACIAL - CUTIS MADURO \r\nRecuerda que la juventud se lleva en el alma, ¡No dejes que se apague la luz que hay en ti! Cuida tu piel durante el día y ayúdale a retrasar el envejecimiento de sus células. Fórmula rica en emolientes que colaboran para mejorar la elasticidad de la piel, de textura ligera y suave. Hidrata y dale a tu piel una apariencia suave y tersa.', 'Crema Nutritiva De Día Para Pieles Maduras\r\nLa juventud se lleva en el alma y en la piel.', '- Promueve una apariencia suave, tersa y luminosa - Hidrataci&oacute;n prolongada - Ayuda a mejorar la elasticidad y flexibilidad de la piel - Enriquecida con vitaminas A, E y C - Con ubiquinona, ceramidas, hialuronato de sodio, extracto de regaliz, aceites de t&eacute; verde, girasol, soya y c&aacute;rtamo.', '9501101_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (118, 118, 1, 'Crema Nutritiva De Noche Para Pieles Madura', 'Crema Nutritiva De Noche Para Pieles Maduras.\r\nCUIDADO DE LA PIEL / FACIAL - CUTIS MADURO \r\n¡No importan los años! Tú tienes la edad que quieres y sientes. Por su combinación de ingredientes, ayuda a hidratar el cutis, dejando la piel con una apariencia suave, tersa y luminosa. ¡Úsala por la noche! Contiene antioxidantes y vitaminas E y C.', 'Crema Nutritiva De Noche Para Pieles Maduras.\r\n¡No importan los años! Hidrata el cutis durante la noche', 'No disponible', '9501102_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (119, 119, 1, 'Crema De Cuidado Intensivo Para Contorno De Ojos', 'Crema De Cuidado Intensivo Para Contorno De Ojos\r\nCUIDADO DE LA PIEL / FACIAL - CUTIS MADURO\r\nPara que tu mirada tenga la armonía perfecta, dalé un cuidado intensivo a la delicada zona del contorno de tus ojos. Tonifica, nutre, mejora la elasticidad de tu piel e hidrata de manera prolongada. Por su fórmula con emolientes naturales, revitaliza y suaviza.\r\nRecomendada para todo tipo de pieles.Para que tu mirada tenga la armonía perfecta, dalé un cuidado intensivo a la delicada zona del contorno de tus ojos. Tonifica, nutre, mejora la elasticidad de tu piel e hidrata de manera prolongada. Por su fórmula con emolientes naturales, revitaliza y suaviza.\r\nRecomendada para todo tipo de pieles.', 'Crema De Cuidado Intensivo Para Contorno De Ojos\r\nTu aliada para retrasar los efectos del envejecimiento.', '- Hidrata y tonifica tu piel - Mejora la apariencia del contorno de los ojos - Mejora la elasticidad, flexibilidad e hidrataci&oacute;n de la piel - Enriquecida con aceite de jojoba, vitamina E, hialuronato de sodio y ubiquinona', '9501087_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (120, 120, 1, 'Crema Hidratante Facial Para Piel Sensible', 'Crema Hidratante Facial Para Piel Sensible.\r\nCUIDADO DE LA PIEL / FACIAL - CUTIS SENSIBLE\r\nSi tu rostro es delicado, haz que olvide el mal que le han hecho y dale el cuidado que necesita con una crema ideal para piel sensible. Promueve una hidratación excepcional, la cual colabora a tener una apariencia más suave y tersa. Por sus antioxidantes como la vitamina A y E, ayudan a proteger tu piel de los efectos dañinos del medio ambiente.', 'Crema Hidratante Facial Para Piel Sensible.\r\nSi tu rostro es delicado, dale el cuidado que necesita', 'No disponible', '9501103_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (121, 121, 1, 'Exfoliante Corporal', 'Exfoliante Corporal.\r\nCUIDADO DE LA PIEL / CORPORAL\r\nAhora puedes eliminar las células muertas y darle suavidad y humectación al mismo tiempo, gracias a su fórmula a base de cafeína y aceite de almendras dulces con partículas de cáscara de nuez. Siente sus asombrosos resultados y sorpréndete.', 'Exfoliante Corporal.\r\nElimina las células muertas y da suavidad a tu piel.', '- Proporciona una limpieza profunda en la piel de todo el cuerpo  - con cáscara de almendras y cáscara de nuez, que remueven las células muertas de manera mecánica  - Enriquecida con manteca de karité, aceite de almendras dulces y cafeína.', '9501072_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (122, 122, 1, 'Crema Corporal Para Piel De Naranja', 'Crema Corporal Para Piel De Naranja.\r\nDecídete a recuperar el aspecto joven y fresco de tu piel. Su fórmula con cafeína y L-carnitina te ayuda a minimizar la apariencia de la piel de naranja. La sensación de frescura que te brinda su aroma mentolado es toda una experiencia.', 'Crema Corporal Para Piel De Naranja.\r\nDecídete a recuperar el aspecto joven y fresco de tu piel', '- Mejora la apariencia de la piel de naranja - Hidrata y suaviza la piel - Enriquecida con cafe&iacute;na, L-carnitina, extracto de centella asi&aacute;tica y manteca de karite - Consistencia ligera y r&aacute;pida absorci&oacute;n', '9501078_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (123, 123, 1, 'Gel Para Estrías', 'Gel Para Estrías.\r\nCUIDADO DE LA PIEL / CORPORAL\r\nEs que no eres tú, son ellas? Ayuda a mejorar la apariencia de las indiscretas zonas con estrías. Por su fórmula humectante e ingredientes naturales, colabora a restaurar la elasticidad y prevenir el rompimiento de las fibras de colágeno. Ideal para los efectos después del embarazo y los cambios de peso. Se trata de un gel ligero de textura suave, y no pegajoso, formulado con extracto de pepino, colágeno hidrolizado, moringa y vitamina E; entre otros ingredientes naturales.', 'Gel Para Estrías.\r\nAyuda a mejorar la apariencia de las indiscretas zonas con estrías', '- Ayuda a prevenir y mejorar la apariencia de la piel con estr&iacute;&shy;as - Recomendable durante el embarazo y para el cuidado diario de la piel - Brinda elasticidad y humectaci&oacute;n - Enriquecido con vitamina E, col&aacute;geno hidrolizada, arginina, extractos de pepino, moringa y alantoina', '9501080_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (124, 124, 1, 'Gel Refrescante Facial y Corporal', 'Gel Refrescante Facial y Corporal.\r\nHay momentos en los que necesitas refrescar tu piel, como después de tomar el sol. Con el Gel Refrescante Facial y Corporal SEYTÚ, disfruta una sensación de alivio y tonificación de tu piel proporcionada por sus agentes humectantes y sus ingredientes de origen natural.', 'Gel Refrescante Facial y Corporal.\r\nCúbrete de frescura.', '- Proporciona sensación de alivio  - Brinda una Excelente hidratación y frescura  - Ideal para después de la exposición prolongada al sol  - Enriquecido con extractos de aloe vera, caléndula y hamamelis', '9501081_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (125, 125, 1, 'Crema Corporal De Hidratación Profunda Con Aloe Vera', 'Crema Corporal De Hidratación Profunda Con Aloé Vera.\r\nCuando toda la piel de tu cuerpo necesita algo más que hidratación, el alivio llega con la Crema Corporal de Hidratación Profunda con Aloé Vera que, con sus emolientes y humectantes, actúan de forma inmediata gracias a su fórmula mejorada.', 'Crema Corporal De Hidratación Profunda Con Aloé Vera.\r\nHidratación total.', '- Hidrataci&oacute;n inmediata - R&aacute;pida absorci&oacute;n mejorada - Textura ideal para masaje - Enriquecida con extractos de manzanilla, romero, alga marina, cola de caballo, l&uacute;pulo, vitamina A y E.', '9501104_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (126, 126, 1, 'Crema Para Manos', 'Crema Para Manos/Hand Lotion\r\nLa piel de tus manos es muy delgada y sensible. Sin embargo, la sometemos a múltiples factores que las maltratan y deshidratan día con día.\r\nPara brindarles el cuidado necesario, existe la Crema Para Manos SEYTÚ, con una fórmula optimizada con vitamina C, aceite de almendras y semilla de uva, para dotarlas de un tacto saludable y muy suave.', 'Crema Para Manos/Hand Lotion\r\nLa mejor humectación a la mano.', '- Especialmente formulada para la piel de las manos  - Acondiciona y colabora mejorando la elasticidad y firmeza de la piel  - Enriquecido con vitamina C, extracto de vainilla, ácido glicólico y colágeno hidrolizado', '9501097_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (127, 127, 1, 'Crema De Manos Vainilla', 'Crema De Manos Vainilla. \r\nNo sufras por la resequedad y elimina gérmenes mientras das suavidad y humectación a tu piel; cuenta con proteína de trigo hidrolizada. Altamente efectivo, desinfecta y logra una apariencia tersa y saludable. Viene en tres deliciosos aromas frutales: sandía-melón, manzana-pera y vainilla.', 'Crema De Manos Vainilla.\r\nNo sufras por la resequedad y elimina gérmenes mientras das suavidad y humectación a tu piel.', '- Mant&eacute;n la higiene en tus manos de una manera suave y sin resecar tu piel - Con hialuronato de sodio y manteca de Karit&eacute;, agentes humectantes y acondicionadores de la piel - Aromas disponibles: vainilla, manzana con pera, y sand&iacute;a con mel&oacute;n', '9501075_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (128, 128, 1, 'Crema De Manos Manzana-Pera', 'Crema De Manos Manzana-Pera.\r\nNo sufras por la resequedad y elimina gérmenes mientras das suavidad y humectación a tu piel; cuenta con proteína de trigo hidrolizada. Altamente efectivo, desinfecta y logra una apariencia tersa y saludable. Viene en tres deliciosos aromas frutales: sandía-melón, manzana-pera y vainilla.', 'Crema De Manos Manzana-Pera.\r\nNo sufras por la resequedad y elimina gérmenes mientras das suavidad y humectación a tu piel', 'No disponible', '9501076_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (129, 129, 1, 'Crema De Manos Sandía-Melón', 'Crema De Manos Sandía-Melón\r\nNo sufras por la resequedad y elimina gérmenes mientras das suavidad y humectación a tu piel; cuenta con proteína de trigo hidrolizada. Altamente efectivo, desinfecta y logra una apariencia tersa y saludable. Viene en tres deliciosos aromas frutales: sandía-melón, manzana-pera y vainilla.', 'Crema De Manos Sandía-Melón\r\nNo sufras por la resequedad y elimina gérmenes mientras das suavidady humectación a tu piel', 'No disponible', '9501077_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (130, 130, 1, 'Oml Plus Gel Premium (Crema de gel)', 'El plus que tu piel se merece. Cuando se trata de cuidar tu piel, OML Gel Premium tiene todo - más de lo que te podrías imaginar. Enriquecido con una combinación de extractos y antioxidantes que colaboran a mantener las células protegidas de los ataques producidos por los radicales libres y aumentar el nivel de hidratación. Evita la resequedad de la piel. Mejora la elasticidad y flexibilidad de la piel. Promueve una apariencia suave, tersa y saludable. Contiene extractos naturales de levadura, hoja de olivo, árnica, frutas silvestres, aceite de jojoba y bisabolol.', 'Tu mejor aliado para hidratar, humectar y acondicionar la piel\r\n-Su extracto de OML Plus contiene una combinación de extractos de plantas que de manera natural colaboran como antioxidantes, apoyan la formación de colágeno y ayudan a aumentar el nivel de la humedad. Además está enriquecido con extractos naturales como: Levadura, Hoja de Olivo, Arnica y Frutas Silvestres, asi como Aceite de Jojoba.\r\n', ' - Hidrata, humecta y mejora la apariencia de tu piel  - Ayuda mejorando la elasticidad y flexibilidad de la piel   - Promueve una textura suave, tersa y saludable sobre la piel  - Contiene extractos de levadura, hoja de olivo, árnica, frutas silvestres, aloe vera, aceite de jojoba y bisabolol.', '9501082_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (131, 131, 1, 'Corrector Líquido Lights', 'Corrector Líquido Light.\r\nHaz que tu rostro luzca impecable con nuestro Corrector Líquido, que te ayuda a disimular las molestas imperfecciones y finas líneas de expresión. Olvídate del efecto graso, pues por su textura suave y ligera, podrás lograr una apariencia impecable y natural. Contiene minerales, extracto de té verde y vitaminas A y E, que además de poseer propiedades antioxidantes, acondicionan y protegen la piel.\r\nTono: Light', 'Corrector Líquido Light.\r\nHaz que tu rostro luzca impecable.', 'No disponible', '9516011_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (132, 132, 1, 'Maquillaje Compacto 2 En 1 ? Natural', 'Maquillaje Compacto 2 En 1? Natural.\r\nMAQUILLAJE / BASE\r\nFórmula con minerales. 2 en 1, te permite tener un acabado cremoso tipo base al humedecer previamente la esponja en agua y sellar tu maquillaje al aplicar en seco dando un acabado mate y aterciopelado en tu piel, eliminando el brillo. Excelente Cobertura, acabado natural y textura ultra fina de larga duración. Estuche con espejo y esponja para una fácil aplicación.\r\nTonos: Natural, Fair y Medium', 'Maquillaje Compacto 2 En 1? Natural.\r\n2 en 1 ¡úsalo como base o sellador!', 'No disponible', '9511021_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
