INSERT INTO `product_language` VALUES (140, 140, 1, 'Rubor Compacto ? Petal', 'Rubor Compacto ? Petal\r\nMAQUILLAJE / BASE\r\nSu textura ultra sedosa brinda una excelente cobertura con un acabado natural y luminoso. Su fórmula de larga duración, se difumina fácilmente sobre tus mejillas. Gracias a su innovador estuche con espejo, brocha y pad difuminador logra trazos perfectos que llevarán tu maquillaje a un nuevo nivel.', 'Rubor Compacto ? Petal\r\nDefine tu rostro y acentúa la belleza de tus rasgos', 'No disponible', '9509012_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
