INSERT INTO `product_language` VALUES (146, 146, 1, 'Delineador Para Ojos Penliner-Negro', 'Delineador Para Ojos Penliner.\r\nMAQUILLAJE / OJOS\r\n¡Sácale el mayor provecho a tu mirada! Su punta tipo plumón brinda un control exacto en cada trazo de tu delineado. Con su nueva fórmula diseñada a base de agua, libre de formaldehídos, con tacto sedoso para la delicada zona de los ojos y duración de hasta 14 horas; proporciona un color intenso que resalta la belleza de tus ojos, además es resistente al agua y de secado rápido. Juega con tu look y dalé un toque dramático e intenso.', 'Delineador Para Ojos Penliner.\r\nDalé un toque dramático e intenso a tu mirada.', 'No disponible', '9506011_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (147, 147, 1, 'Delineador Líquido Para Ojos Negro', 'Delineador Liquido Para Ojos Negro. \r\nEl Delineador Líquido Para Ojos cuenta con una punta tipo pincel, con el que se logran trazos precisos para un tono intenso y de larga duración, que dan una mayor profundidad a tu mirada.', 'Delineador Líquido Para Ojos Negro.\r\nResalta la belleza de tus ojos.', 'No disponible', '9505063_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (148, 148, 1, 'Set Delineador Compacto Para Cejas', 'Set Delineador Compacto Para Cejas.\r\nMAQUILLAJE / OJOS\r\nDalé a tus cejas un acabado definido y con volumen. Cuenta con una paleta de colores que se complementan para dar una apariencia totalmente natural. Perfecciona el marco de tus ojos, acabados de larga duración, textura extra suave y cremosa. \r\nPráctico set que incluye pinza, aplicador, brocha para cejas, espejo, 2 tonos de sombra y un iluminador.', 'Set Delineador Compacto Para Cejas.\r\nDalé a tus cejas un acabado definido y con volumen', 'No disponible', '9520011_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (149, 149, 1, 'Brillo Labial ? Cotton Candy', 'Brillo Labial ? Cotton Candy\r\nMAQUILLAJE / LABIOS \r\nFórmula diseñada para cuidar la piel de tus labios, mientras su brillo te da una sonrisa deslumbrante. Deliciosas fragancias con un toque de sabor, color intenso de larga duración. Textura ligera no pegajosa enriquecida con vitamina E y aceite de ricino, que brindan hidratación y protegen tus labios de los radicales libres Envase vanguardista con luz y espejo para una perfecta aplicación.\r\nTonos: Cotton Candy, Funky Pink, Juicy Apple, Red Passion, Very Berry y Watermelon Punch', 'Brillo Labial ? Cotton Candy\r\nUn toque de color y destellos sin igual', 'No disponible', '9515041_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
