INSERT INTO `product_language` VALUES (160, 160, 1, 'Shampoo Con Extractos Herbales De Origen Natural', 'Shampoo Con Extractos Herbales De Origen Natural.\r\nCUIDADO CAPILAR / CUIDADO DIARIO\r\nDeja tu cabello en manos de la naturaleza para que luzca sensacional. Esta fórmula con extractos de Omniplus y otros ingredientes de origen natural, como el aloe vera; están enfocados a mantener la hidratación, suavidad, brillo y acondicionamiento del cabello.', 'Shampoo Con Extractos Herbales De Origen Natural.\r\nDeja tu cabello en manos de la naturaleza para que luzca sensacional', '- hidratación y suavidad  - Favorece al brillo  - para todo tipo de cabello  - con extracto de Omniplus, proteína hidrolizada de trigo y pantenol', '9504032_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (161, 161, 1, 'Acondicionador Con Extractos Herbales De Origen Natural', 'Acondicionador Con Extractos Herbales De Origen Natural.\r\nCUIDADO CAPILAR / CUIDADO DIARIO\r\nDeja que tu cabello se exprese y consiéntelo con nuestro acondicionador. Disfruta de su aroma frutal mientras le das vitalidad, brillo y suavidad a tu cabellera, con sus ingredientes de origen natural y extracto de Omniplus; la fórmula también contiene centella asíatica, equinacea, manzanilla y ginseng que la hacen ideal para la humectación de tu cabellera.', 'Acondicionador Con Extractos Herbales De Origen Natural.\r\nDeja que tu cabello se exprese y consiéntelo con nuestro acondicionador', '- Colabora en el fortalecimiento y humectaci&oacute;n de la fibra capilar - Para todo tipo de cabello, incluyendo te&ntilde;ido y maltratado - Con extracto de Omniplus y prote&iacute;na de trigo', '9504033_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (162, 162, 1, 'Shampoo De Cuidado Especial Para Cabello Débil', 'Shampoo De Cuidado Especial Para Cabello Débil\r\nCuida, fortalece e hidrata tu cabello débil con esta fórmula', 'Shampoo De Cuidado Especial Para Cabello Débil\r\nCUIDADO CAPILAR / CUIDADO DIARIO\r\nPorque lavarlo no es suficiente, cuida, fortalece e hidrata tu cabello débil con esta fórmula que contiene extractos de guaraná, mezcla de aceites esenciales, proteínas y acondicionadores capilares; además, colabora en la estimulación de la recuperación capilar.', '- Excelente hidratación y acondicionamiento  - Formulado Especialmente para ayudar en el fortalecimiento de la fibra capilar  - Provee brillo, suavidad y flexibilidad a tu cabello  - Enriquecido con biotina, proteína de leche, extracto de guaraná, aceites de limón, romero, orégano y lavanda.', '9504039_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (163, 163, 1, 'Shampoo Color Protect', 'Shampoo Color Protect\r\nCUIDADO CAPILAR / CUIDADO DIARIO\r\nConserva la elegancia de ese look que tanto te gusta! Nuestro Shampoo Color Protect ayuda a mantener el color del cabello teñido y químicamente tratado, colaborando en su protección de la raíz a la punta; además, ayuda a aumentar su resistencia y le brinda mayor flexibilidad. ¡Que nada opaque tu brillo! Contiene extracto de semillas de girasol y extracto de melocotón.', 'Shampoo Color Protect\r\nAyuda a mantener el color del cabello teñido y químicamente tratado', '- ayuda protegiéndolo después de un proceso de coloración  - Contribuye aumentando la resistencia del cabello de la raíz a la punta  - Excelente brillo y suavidad  - ayuda extendiendo la vida de tu tinte  - Enriquecido con extractos de melocotón y semilla de girasol', '9504040_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (164, 164, 1, 'Gel Fijador Para El Cabello', 'Gel Fijador Para El Cabello.\r\nCUIDADO CAPILAR / CUIDADO DIARIO\r\n¿Necesitas un cambio de look? ¡Reinvéntate cuantas veces quieras! Formulado con ingredientes naturales y extracto de Omniplus, nuestro Gel Fijador será tu mejor aliado para darle forma y moldear tu estilo; además, ayuda en el fortalecimiento del cuero cabelludo y le da un brillo natural a tu cabello. Es libre de alcohol y no deja residuos. Ideal para conservar tú peinado durante todo el día.', 'Gel Fijador Para El Cabello.\r\n¡Reinvéntate cuantas veces quieras!', 'Contiene extracto de Omniplus. Libre de alcohol. No deja residuos. Excelente brillo.', '9504031_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (165, 165, 1, 'Complejo Multivitamínico Capilar', 'Complejo Multivitamínico Capilar.\r\nDale un cuidado extra con este tratamiento enriquecido con vitaminas y extractos naturales, como semilla de trigo, limón, manzana, melocotón, ginseng y queratina hidrolizada. Su fórmula mejorada actúa como coadyuvante y reestructurador de las fibras capilares, además, contribuye a controlar el frizz mientras proporciona volumen y suavidad al cabello.', 'Complejo Multivitamínico Capilar.\r\nDale un cuidado extra con este tratamiento capilar\r\n', '- Tratamiento intensivo para cabello reseco y maltratado - Colabora en la restructuraci&oacute;n de la fibra capilar - Ayuda a controlar el frizz - Excelente brillo y suavidad - Enriquecido con vitaminas y 9 extractos bot&aacute;nicos', '9504034_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (166, 166, 1, 'Mascarilla Reparadora Capilar', 'Mascarilla Reparadora Capilar.\r\nCUIDADO CAPILAR / CUIDADO INTENSIVO\r\nConsciente a tu cabello y regálale una apariencia sedosa, manejable y luminosa. Por su mezcla de ingredientes, proporciona suavidad, flexibilidad e hidratación. Renueva las fibras capilares frágiles, resecas y dañadas. Humecta y brinda una barrera protectora para evitar la resequedad. Revitaliza el cabello hasta recuperar su aspecto saludable.', 'Mascarilla Reparadora Capilar.\r\nConsciente a tu cabello y regálale una apariencia sedosa', '- Acondiciona intensamente el cabello  - ayuda a restaurar las fibras capilares frágiles, secas y dañadas  - ayuda a disminuir el frizz  - Enriquecida con queratina hidrolizada, extractos de algas marinas E ínula', '9504035_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (167, 167, 1, 'Tinte Castaño Oscuro', 'Tinte Castaño Oscuro\r\nCUIDADO CAPILAR / COLOR\r\nAl teñir tu cabello de un color diferente puedes lograr los looks más increíbles, ¡deja que tu creatividad te reinvente! Por su mezcla de ingredientes, nuestro Tinte Semi-Permanente favorece a un acondicionamiento revitalizante para una flexibilidad e hidratación incomparables. Diseñado para brindar una cobertura natural sin dañar las fibras capilares. Resiste de 10 a 15 lavadas. Su fórmula profesional es de última generación, libre de Amoniaco y te brinda una cobertura natural sin dañar las fibras capilares ni el cuero cabelludo.', 'Tinte Castaño Oscuro\r\nBrinda una cobertura natural sin dañar las fibras capilares', 'No disponible', '9518031_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
