INSERT INTO `product_language` VALUES (181, 181, 1, 'Magnus Supreme Caja', 'Magnus Supreme Box/Caja\r\nLas Vitaminas del complejo B participan en la función cerebral y en la producción de energía.\r\nLa Glicina favorece en  el buen  funcionamiento del sistema nervioso.\r\nLa Taurina colabora en el estado de alerta del organismo.', 'Magnus Supreme Box/Caja\r\nContiene : Vitaminas del complejo B, taurina ,glicina, estevia.\r\n Sabor: Cítrico ', 'Con agua Blu Supreme. A cualquier hora del día.', '2075722_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (182, 182, 1, 'Rubor Compacto - Nectar', 'Rubor Compacto - Nectar\r\nMAQUILLAJE / BASE\r\nSu textura ultra sedosa brinda una excelente cobertura con un acabado natural y luminoso. Su fórmula de larga duración, se difumina fácilmente sobre tus mejillas. Gracias a su innovador estuche con espejo, brocha y pad difuminador logra trazos perfectos que llevarán tu maquillaje a un nuevo nivel.', 'Rubor Compacto - Nectar\r\nDefine tu rostro y acentúa la belleza de tus rasgos.', 'No disponible', '9509011_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (183, 183, 1, 'Sombra para ojos y larga duracion - Gipsy Fair', 'Sombra para ojos y larga duración - Gipsy Fair\r\nMAQUILLAJE / OJOS\r\nGamas en tonos modernos y elegantes, que se complementan para lograr la combinación perfecta. Lleva tu look de lo natural a lo dramático, humedece la brocha antes de aplicar, y logra efectos únicos mediante tonos intensos. Tecnología de larga duración contiene vitamina E que ayuda a proteger la piel de los radicales libres.\r\nTonos: Divine Autum, Gala Collection, Gipsy Fair y Party Time.', 'Sombra para ojos y larga duración - Gipsy Fair\r\nLleva tu look de lo natural a lo dramático.', 'No disponible', '9514064_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (184, 184, 1, 'Rimel de Agua - Negro', 'Rimel de Agua - Negro', 'Rimel de Agua - Negro', '- Libre de grumos - Color intenso - Secado r&aacute;pido - M&aacute;ximo alargamiento - Gran volumen.', '9512021_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (185, 185, 1, 'Labial Hidratante -Silver Rose', 'Labial Hidratante -Silver Rose\r\nMantiene tus labios hidratados con su fórmula enriquecida con manteca de karité y vitamina E, que suavizan y nutren intensamente tus labios. Pigmentos de máxima fidelidad, textura ligera y cremosa que se desliza suavemente.\r\nTonos: Silver Rose, Pure Red, Raspberry, Rosey, Cocoa y Wine Berry', 'Labial Hidratante -Silver Rose\r\nColores intensos para unos labios increíbles', '- Labios hidratados y suaves  - Color intenso   - Excelente fijación  - Textura ligera y cremosa que se desliza suavemente', '9517046_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (186, 186, 1, 'Maquillaje Liquido- Simply Natural', 'Maquillaje Liquido- Simply Natural\r\nFórmula innovadora que proporciona una cobertura equilibrada y translúcida, dando a tu piel un tono uniforme y natural para el día a día, sin sensación grasosa y efecto mate. Ideal para todo tipo de piel. Enriquecida con colágeno, aceite de jojoba y vitamina E, para una piel radiante e hidratada. Fácil de retirar. Envase con brocha incluida para una aplicación uniforme con seguro antiderrame.\r\nTonos: Creamy Natural, Golden Beige, Natural Beige, Nude Beige, Pale y Simply Natural', 'Maquillaje Liquido- Simply Natural\r\nLuce un rostro natural en tu día a día', 'No disponible', '9508016_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (187, 187, 1, 'Oml Fibra Supreme Caja  30 sobres', 'Oml Fibra Supreme Caja  30 sobres\r\nLa Inulina de agave es una fibra soluble que posee efectos prebióticos además de colaborar en el cuidado del sistema digestivo. \r\n La Fibra de avena y soya pueden ayudar a reducir los incrementos de azúcar en sangre después de alimentos, pues por su aporte de fibra ayudan a retardar su absorción en el intestino. \r\nEl Salvado de maíz puede favorecer el tránsito intestinal y promueve la sensación de saciedad.\r\n', 'Oml Fibra Supreme Caja  30 sobres\r\nContiene : Mezcla de fibras (salvado de avena, salvado de maíz y fibra de soya), inulina de agave, estevia. Sabor Durazno.', 'Con agua Blu Supreme. 30 minutos antes de los alimentos.', '1578400_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
