INSERT INTO `product_language` VALUES (203, 203, 1, 'Maquillaje Compacto 2 En 1 -Light', 'Maquillaje Compacto 2 En 1 -Light\r\nMAQUILLAJE / BASE\r\nFórmula con minerales. 2 en 1, te permite tener un acabado cremoso tipo base al humedecer previamente la esponja en agua y sellar tu maquillaje al aplicar en seco dando un acabado mate y aterciopelado en tu piel, eliminando el brillo. Excelente Cobertura, acabado natural y textura ultrafina de larga duración. Estuche con espejo y esponja para una fácil aplicación.\r\nTonos: Natural, Fair y Medium', 'Maquillaje Compacto 2 En 1 -Light\r\n2 en 1¡úsalo como base o sellador!', 'No disponible', '9511023_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (204, 204, 1, 'Maquillaje Líquido UP+ Creamy Natural', 'Maquillaje Líquido UP+ Creamy Natural\r\n-Resistente al agua\r\n- Larga duración\r\nActivos anti-edad\r\nExcelente poder cubriente y matificante', 'Maquillaje Líquido UP+ Creamy Natural', 'No disponible', '9508020_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (205, 205, 1, 'Crema Facial Hidratante Para Hombre', 'La piel de tu rostro requiere una crema especializada en sus necesidades de hidratación, que no se encuentra en las cremas tradicionales.\r\n\r\nLa Crema Facial Hidratante para Hombre SEYTÚ tiene extractos naturales con antioxidantes que humectan, suavizan y benefician la prevención del envejecimiento prematuro provocado por los rayos solares.\r\n', '-Rápida absorción\r\n-Consistencia ligera sin sensación grasosa\r\n-Con protección solar\r\n-Enriquecido con vitamina E y aloe vera\r\n', '- R&aacute;pida absorci&oacute;n - Consistencia ligera sin sensaci&oacute;n grasosa - Con protecci&oacute;n solar - Enriquecido con vitamina E y Aloe Vera', '9501105_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (206, 206, 1, 'Gel de Afeitar y Limpiador Facial 2 En 1', 'Con el Gel de Afeitar y Limpiador Facial 2 en 1, reduce completamente al ras la barba y deja tu rostro libre de impurezas. Te dejará una sensación de frescura en cada afeitada.', 'Afeitado suave\r\n-Fórmula 2 en 1 para afeitar y dar una limpieza diaria\r\n-Con agentes tensoactivos que cuidan la piel\r\n-Enriquecido con alantoína y mentol\r\n', '- Afeitado suave  - Fórmula 2 en 1 para afeitar y dar una limpieza diaria  - Con tensoactivos que cuidan la piel  - Enriquecido con alantoína y mentol  - Efecto refrescante', '9501107_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (207, 207, 1, 'Bálsamo Para Después de Afeitar', 'Refresca tu rostro y reduce la irritación que produce la rasurada con el Bálsamo para Después de Afeitar de SEYTÚ, que ayuda a regenerar las células dañadas por la acción del rastrillo. \r\n\r\nDisfruta de esa agradable sensación que te proporcionan sus extractos naturales al empezar a actuar en tu piel.\r\n', 'Ayuda a regenerar las células de la piel\r\n-Hidrata y suaviza\r\n-Rápida absorción\r\n-Enriquecido con vitamina E, extracto de avena, aloe vera, cafeína y mentol\r\n', 'No disponible', '9501106_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (208, 208, 1, 'Desodorante Mineral -Mujer', 'A diferencia de la mayoría de los que encuentras en el mercado, el Desodorante Mineral SEYTÚ está hecho con piedra de alumbre, que combate el mal olor al eliminar las bacterias que lo provocan a la vez que deja respirar y humecta la delicada piel de tus axilas.\r\n\r\nAplícalo varias veces durante los primeros días, para que tu cuerpo se acostumbre a esta forma natural de decir adiós al mal olor.\r\n', 'Elimina y controla el mal olor \r\n-No tapa los poros, permite que tu piel respire \r\n-Fragancias suaves, ligeras y frescas \r\n-Con alantoina, aloe vera y piedra de alumbre; libre de alcohol\r\n', '- Ayuda a controlar el mal olor\r\n- No tapa los poros, permite que tu piel respire\r\n- Libre de alcohol\r\n- Fragancias suaves, ligeras y frescas\r\n- Con alantoina, extracto de aloe vera y piedra de alumbre', '9510021_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (209, 209, 1, 'Desodorante Mineral -Hombre', 'A diferencia de la mayoría de los que encuentras en el mercado, el Desodorante Mineral SEYTÚ está hecho con piedra de alumbre, que combate el mal olor al eliminar las bacterias que lo provocan a la vez que deja respirar y humecta la delicada piel de tus axilas.\r\n\r\nAplícalo varias veces durante los primeros días, para que tu cuerpo se acostumbre a esta forma natural de decir adiós al mal olor.\r\n\r\n', 'Elimina y controla el mal olor \r\n-No tapa los poros, permite que tu piel respire \r\n-Fragancias suaves, ligeras y frescas \r\n-Con alantoina, aloe vera y piedra de alumbre; libre de alcohol\r\n', 'No disponible', '9510022_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (210, 210, 1, 'OML Viu Supreme Caja con 30 Sobres (150G)', 'Suplemento alimenticio sin azúcar, endulzado con estevia, con vitaminas A, C y E, luteína y zeaxantina (carotenoides), con extractos de grosella, arándano, jamaica y uva, así como con omega 3. En conjunto, complementan una alimentación saludable y aportan beneficios al organismo para su buen funcionamiento gracias a sus propiedades nutricionales y antioxidantes. Sus principales beneficios se centran en el mantenimiento de la salud visual.', '-Salud visual\r\n-Brinda protección contra los rayos UV\r\n-Endulzado con estevia\r\n', 'No disponible', '5827415_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
INSERT INTO `product_language` VALUES (211, 211, 1, 'Seytu Kit -Español 17', 'Seytu Kit -Español', 'Seytu Kit -Español', 'No disponible', '9410350_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
