INSERT INTO `product_language` VALUES (213, 213, 1, 'Oml Shake Supreme Fresa Caja 12 Sobres', 'Una deliciosa malteada con sabor a fresa en sustitución de comida endulzada con estevia y formulada a base de proteína de soya, carbohidratos, fibra, vitaminas y minerales. Complementa una alimentación saludable y aporta beneficios al organismo para su óptimo funcionamiento. Está diseñada para sustituir el desayuno y/o la cena, de manera que al consumirse junto con una dieta saludable, contribuye a la pérdida de peso. \r\n\r\n', '-Control de peso\r\n-Contribuye a un organismo fuerte y saludable\r\n-Aporta una fuente saludable de energía\r\n-Endulzado con estevia\r\n', 'Con agua Blu Supreme. En el desayuno y/o cena. Caliente o frío.', '7170921_1', NULL, '2017-12-04 13:45:39', '2017-12-04 13:45:39', NULL, 1, 1);
